            houses.Add(new House()
            {
                Name = "Baratheon of King's Landing",
                Information = @"House Baratheon of King's Landing is an extinct cadet branch of the original House Baratheon of Storm's End. It had been the royal house of Westeros since the defeat of and exile of the Targaryen dynasty following Robert's Rebellion. Their seat was the Red Keep in the city of King's Landing and their domains were the lands ruled directly by the Iron Throne, the Crownlands. After the destruction of the Great Sept of Baelor, with King Tommen I's suicide, House Baratheon of King's Landing is now extinct. Nonetheless its parent house, House Baratheon, was revived by Queen Daenerys Targaryen after she legitimized Robert's bastard son Gendry and gave him the lordship of Storm's End. In reality, House Baratheon of King's Landing became a puppet house of House Lannister the moment Joffrey I ascended; all three of Robert Baratheon and Cersei Lannister's supposed children were actually the products of an incestuous relationship between Cersei and her twin brother Jaime. ",
