            houses.Add(new House()
            {
                Name = "Florent",
                Information = @"House Florent of Brightwater Keep is a vassal house that holds fealty to Lord Bronn of Highgarden. Their seat is Brightwater Keep. The head of the house holds the title of Lord of Brightwater Keep. The Florent sigil is a red gold fox's head on an ermine background. House Florent had close ties to House Gardener when they were the Kings of the Reach prior to the Wars of Conquest. House Tyrell were installed as Wardens of the South after King Mern IX Gardener was killed fighting Aegon the Conqueror. House Florent resents the elevation of House Tyrell and believe they have a more valid claim to the position. They fought for Stannis Baratheon in the War of the Five Kings as Selyse Florent was the wife of Stannis.",
                Banner = ""
            });


            houses.Add(new House()
