                Name = "Forrester",
                Information = @"House Forrester of Ironrath is an exiled noble house from the Wolfswood in the North of Westeros. They are vassals of the Glovers of Deepwood Motte, as well as staunch Stark bannermen. Their seat of power is the wooden castle of Ironrath. Their house words are ""Iron From Ice"", which echo their belief that - like the ironwood itself - the adverse conditions and unforgiving landscape of the North only makes them stronger. House Forrester's heraldry is a white ironwood tree on a black field, embellished with a black sword pointed downwards. Following their defeat at the Battle of Ironrath, House Forrester has been exiled while Ironrath is occupied by their rivals, House Whitehill of Highpoint. However, with Jon Snow retaking Winterfell from Ramsay Bolton and restoring House Stark as the rulers of the North, House Forrester's position is currently unknown. ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Frey",
                Information = @"House Frey of the Twins is the former Great House of the Riverlands, having gained their position for their treachery against their former liege lords, House Tully, who were stripped of all their lands and titles for their rebellion against the Iron Throne; House Tully had supported the independence movement for the Kingdom of the North. The current head of the house is unknown following the assassinations of Lord Walder Frey and two of his sons, Lothar Frey and Walder Rivers, by the vengeful Arya Stark. This is made more complex by the subsequent assassination of all male Freys soon after. After the defeat of Cersei Lannister, Edmure Tully took back his title of Lord of the Riverlands and Riverrun became the Great House of the Riverlands again. Their ancestral seat is known as the Twins for its two identical keeps on both sides of a river linked by a bridge, sometimes called the Stone Bridge. The Twins is one of the primary crossings over the Green Fork of the Trident River, and tolls from bridge crossings have made the Freys quite wealthy fairly quickly, elevating them from obscurity six centuries ago to being one of the most powerful noble houses in the Riverlands - though they are looked down upon by older aristocratic families. The construction of the Twins took the Freys for three centuries, and ever since they have grown wealthy by charging the travelers crossing the Twins. The heraldry of House Frey represents their castle-seat of the Twins: it consists of two grey towers linked by a bridge, on a darker grey background, over an escutcheon of blue water. Their house words are ""We Stand Together,"" ironic considering the Freys' frequent infighting between family members, but it could also refer to their seat, the Twins, standing together. ",
