                Information = @"House Karstark of Karhold, formerly known as House Stark of Karl's Hold, is an extinct vassal house that held fealty to House Stark of Winterfell, and briefly did so for House Bolton of the Dreadfort after the Red Wedding due to Robb Stark executing their lord, Rickard Karstark, for treason during the War of the Five Kings. Their lands are northeast of Winterfell, located in heavy forested lands overlooking the Shivering Sea. Their stronghold is a castle called Karhold and the head of the house is the Lord of Karhold. The Karstark sigil is a white sunburst on black. Their house words are ""The Sun of Winter."" ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Lannister",
                Banner = "",
                Information = @"House Lannister of Casterly Rock is one of the Great Houses of Westeros, one of its richest and most powerful families and one of its oldest dynasties. It was also the royal house of the Seven Kingdoms following the extinction of House Baratheon of King's Landing, which had been their puppet house during the War of the Five Kings, for a brief stint of time until House Targaryen took back the Iron Throne in Daenerys Targaryen's war for Westeros. The Lannisters rule over the Westerlands. Their seat is Casterly Rock, a massive rocky promontory overlooking the Sunset Sea which has had habitations and fortifications built into it over the millennia. They are the Lords Paramount of the Westerlands and Wardens of the West. As the new royal house, they also ruled directly over the Crownlands from their seat of the Red Keep in King's Landing, the traditional seat of the royal family. House Lannister's Heraldry consists of a golden lion on a crimson background, and their House words are ""Hear me roar!"", which are rarely mentioned. Their unofficial motto, which is as well known as the official one, is ""A Lannister always pays his debts"" - which is used much more often and mostly in negative context, though it can also be used in the original, literal sense. The incestuous relationship of Cersei and Jaime had been concealed in a conspiracy. Their son Joffrey Baratheon had claimed the Iron Throne on the premise that he was actually fathered by the late King Robert Baratheon. Lord Tywin was a key supporter of his reign in the War of the Five Kings. The Lannisters continued to hold sway when Tommen Baratheon ascended the throne, with Kevan Lannister as Hand of the King and Protector of the Realm, but lost their hold over Tommen to the Faith of the Seven, and, after destroying the Great Sept of Baelor, Cersei took the throne. With the deaths of Cersei and Jaime at the Battle of King's Landing, Tyrion is now the head of House Lannister and given up the crown in favor of an elective monarchy. It currently swears fealty directly to the King of the Andals and the First Men, an office which is currently held by Bran Stark. "
            });


