            });


            houses.Add(new House()
            {
                Name = "Martell",
                Information = @"House Martell of Sunspear is one of the Great Houses of Westeros. It rules the peninsula of Dorne in the far south of the continent from their castle Sunspear. Though loyal to the Iron Throne, the Martells were never conquered by the Targaryens and pursued a more isolated role in wider political events since Robert's Rebellion. House Martell's sigil is a red sun pierced by a golden spear, on an orange field, a combination of the original Martell sigil - a yellow spear - and the emblem of Princess Nymeria - a red sun - to symbolize the marriage of the warrior-queen to Mors Martell. Their house words are ""Unbowed, Unbent, Unbroken."" With the assassinations of Prince Doran Martell and his only heir, Prince Trystane, by Ellaria Sand and the three eldest Sand Snakes, the Sand Snakes carried the Martell blood through their father Oberyn Martell. The Sand Snakes also continued to use the Martell sigil to represent themselves and Dorne. Under the leadership of Ellaria Sand and the Sand Snakes, the forces of House Martell and Dorne were aligned to support the cause of Daenerys Targaryen against House Lannister after they declared war against them. Following the deaths of the older Sand Snakes and Ellaria's imprisonment in King's Landing and likely death, an unnamed Martell acquires the lordship of Dorne, becoming its prince. ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Mormont",
                Information = @"House Mormont of Bear Island is an extinct vassal house from the North that held fealty to House Stark of Winterfell. They ruled Bear Island, an island far to the northwest of Winterfell. The head of the house was the Lord of Bear Island. The family possessed the Valyrian sword Longclaw, which later was given to Jon Snow. House Mormont's sigil shows a rampant black bear on a white field, surrounded by a green escutcheon. Their house words are ""Here We Stand."" ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Reed",
                Information = @"House Reed of Greywater Watch is a vassal house that holds fealty to House Stark of Winterfell. House Reed is the southern-most house of the North. They control the vast area of swampland and bog stretching across the narrowest part of the continent of Westeros, the Neck. The Reeds and their vassals are Crannogmen, a distinct offshoot of the First Men who have adapted to living in the swamps of the Neck. House Reed's heraldry is a black lizard-lion on a grey-green field. The head of the house is the Lord of Greywater Watch. ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Royce",
                Information = @"House Royce of Runestone is a vassal house which holds fealty to House Arryn of the Vale. It formerly was a vassal of House Stark of Winterfell, but now recognizes the Lord of the Six Kingdoms as its king. Their seat is Runestone, located east of the Eyrie, on the coast of the Narrow Sea. It is ruled by the veteran Lord Yohn Royce. House Royce's heraldry consists of a pattern of black pebbles on a bronze field surrounded by runes in the Old Tongue of the First Men. Their house words are ""We Remember."" ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Stark",
                Banner = "",
                Information = @"House Stark of Winterfell is a Great House of Westeros and the royal house of the Kingdom of the North. They rule over the vast region known as the North from their seat in Winterfell. It is one of the oldest lines of Westerosi nobility by far, claiming a line of descent stretching back over eight thousand years. Before the Targaryen conquest, as well as during the War of the Five Kings and early on in Daenerys Targaryen's war for Westeros, the leaders of House Stark ruled over the region as the Kings in the North. Their rule in the North seemingly ended after the events of the Red Wedding when House Frey and House Bolton betrayed House Stark after forming a secret alliance with House Lannister, during which Roose Bolton murdered King Robb Stark. Both the North and Winterfell were taken over by House Bolton. However, the Boltons' hold was jeopardized when Sansa Stark escaped their clutches after learning her brothers Bran and Rickon Stark were still alive and reunited with her half-brother, Jon Snow, at Castle Black. Sansa and Jon marched on the Boltons to save their younger brother Rickon, who was later murdered by Ramsay Bolton, and retake Winterfell. House Stark was restored to their former stature after the Battle of the Bastards. The Stark victory led to House Stark's return to royal status in the North with their bannermen declaring Jon as the King in the North. He later abdicated his title as king in order to gain the full support of Daenerys Targaryen in the Great War, becoming the Warden of the North. Following the Battle of King's Landing, Bran Stark was chosen as the new king of the Six Kingdoms, allowing the North to secede as an independent kingdom under Sansa. House Stark's sigil is a grey direwolf on a white background, over a green escutcheon. They are one of the few noble Houses whose family motto is not a boast or threat. Instead, the House Stark family motto is a warning, one that, no matter the circumstances, will always be relevant: ""Winter Is Coming."""
            });


            houses.Add(new House()
            {
                Name = "Targaryen",
                Information = @"House Targaryen of Dragonstone is an exiled Great House of Westeros and the former royal house of the Seven Kingdoms. House Targaryen conquered and unified the realm before it was deposed during Robert's Rebellion and House Baratheon replaced it as the new royal House. The two surviving Targaryens, Viserys and Daenerys, fled into exile to the Free Cities of Essos across the Narrow Sea. House Lannister replaced House Baratheon as the royal House following the destruction of the Great Sept of Baelor, but the realm was reconquered by Daenerys Targaryen, retaking the Iron Throne following the Battle of King's Landing. After she laid waste to a surrendered King's Landing, Daenerys was assassinated by Jon Snow to prevent further destruction. Jon became the last known living member of House Targaryen and his identity as the son of Rhaegar Targaryen is kept hidden from Westeros. He is exiled to the Night's Watch for the assassination of Daenerys. The bloodline of House Targaryen also still exists in various houses, such as House Baratheon, House Velaryon, and House Martell. House Targaryen's sigil is a three-headed red dragon on a black background, and their house words are ""Fire and Blood."" ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Tarly",
                Information = @"House Tarly of Horn Hill is a noble house from the Reach and formerly a vassal who swore fealty to House Tyrell of Highgarden. Their stronghold is a castle known as Horn Hill and the head of the house is the Lord of Horn Hill. House Tarly has a militarist tradition, and possesses a Valyrian steel sword called Heartsbane. The Tarly sigil is a striding huntsman, red on green. Their house words are ""First in Battle."" They swore allegiance to House Lannister, the new royal family after the extinction of House Baratheon of King's Landing, at the onset of Daenerys Targaryen's war for Westeros, betraying House Tyrell. Lord Randyll Tarly fights alongside Ser Jaime Lannister under the promise of being named Warden of the South after the end of the war. After the executions of Randyll and his son Dickon Tarly in the aftermath of the Battle of the Goldroad, their allegiance is uncertain. Randyll's daughter Talla Tarly has become the new head of the House and Lady of Horn Hill, while his son, Samwell Tarly, is allied with Jon Snow and the Night's Watch. With the end of the war after the Battle of King's Landing, they become the vassals of Lord Bronn of Highgarden. ",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Tully",
                Banner = "",
                Information = @"House Tully of Riverrun is a Great House of Westeros. Its most senior member carried the title of Lord of Riverrun and Lord Paramount of the Trident, until the Red Wedding. The current head is Lord Edmure Tully, son of the late Hoster Tully. The Tully sigil is a silver trout on a red and blue background. Their house words are ""Family,Duty,Honor."" At the onset of the War of the Five Kings, House Tully came under attack by House Lannister and lent its support for House Stark when they came to their aid in the liberation of the Riverlands. House Tully has since been formally stripped of lands and titles for rebellion against the Iron Throne, with Lord Edmure a captive of House Frey following the Red Wedding. Later, Ser Brynden Tully gathered the remaining Tully forces and reclaimed Riverrun from the Freys, reopening conflict between the Tullys and the Iron Throne. The Freys lay siege to Riverrun, and were later assisted by the Lannisters on the orders of King Tommen I. Ser Jaime Lannister managed to end the siege by convincing Edmure Tully to command the garrison to lay down their weapons in return for clemency and protection. Brynden was killed during a final stand with Lannister and Frey forces while Edmure was returned to the Freys as a prisoner. Following the deaths of most of House Frey and the defeat of Cersei Lannister at King's Landing, Edmure is freed and restored to his titles and lands."
            });


            houses.Add(new House()
            {
                Name = "Tyrell",
                Information = @"House Tyrell of Highgarden is an extinct Great House of Westeros. It ruled over the Reach, a vast, fertile, and heavily-populated region of southwestern Westeros, from their castle-seat of Highgarden as Lords Paramount of the Reach and Wardens of the South after taking control of the region from House Gardener during the Targaryen conquest. The House was formerly led by Lord Mace Tyrell. Mace's son Loras was a noted tournament knight and, secretly, the lover of Lord Renly Baratheon. Mace's daughter Margaery married Renly when he crowned himself king in the War of the Five Kings to cement an alliance between Renly and her father. Following Renly's death, Margaery was then married to King Joffrey Baratheon before his assassination at his wedding feast. She was then married to his younger brother, King Tommen Baratheon. Mace's mother, the indomitable Olenna Tyrell, assumed House Tyrell's lordship after Margaery, Loras, and Mace Tyrell were all killed by wildfire at the destruction of the Great Sept of Baelor. Under Olenna, House Tyrell realigned itself with House Targaryen and declared for Daenerys Targaryen in opposition against Cersei Lannister, who had orchestrated the downfall of House Tyrell. With the death of Olenna after the Sack of Highgarden, the House has officially become extinct. In the TV series, the Tyrell family is very small, has only four known members of the main branch. The Tyrell sigil is a golden rose on a pale green field. Their house words are ""Growing Strong.""",
                Banner = ""
            });


            houses.Add(new House()
            {
                Name = "Umber",
                Information = @"House Umber of the Last Hearth is an extinct vassal house that held fealty to House Stark of Winterfell. Their lands were in the far north of the Stark territories, just south of the Wall and the lands held by the Night's Watch. Their stronghold was a castle called the Last Hearth and the head of the house was known as the Lord of Last Hearth. Following the Fall of Last Hearth, an early event of the Great War, House Umber is extinct in the male line. It is unknown whether any female members of the house survived the conflict. House Umber's sigil is four chains linked by a central ring on a dark red field. Their motto is not known at present. ",
                Banner = ""
            });


            houses.Add(new House()
