                Information = @"House Whitehill of Highpoint is a noble house from the Wolfswood in the North of Westeros. They are loyal vassals of House Bolton. Their seat is the stone castle of Highpoint. They are one of the few houses in the North to practice the Faith of the Seven. House Whitehill's heraldry is a white pile inverted on indigo, with a single four-pointed star above. Their house words are ""Ever Higher."" Following the Red Wedding in which House Bolton betrayed House Stark and usurped their position as rulers of the North, House Whitehill becomes embroiled in a conflict with their longtime rivals, House Forrester, for the castle of Ironrath and control of the Ironwood trade. Though many on both sides are killed, House Whitehill ultimately acquires the castle and exiles House Forrester. However, with Jon Snow retaking Winterfell from Ramsay Bolton and leaving House Bolton extinct, House Whitehill's position is currently unknown. ",
                Banner = ""
            });

            return houses;
        }
    }
